import React from 'react'
import Button from '@material-ui/core/Button';

type CustomButtonProps = {
    btnText: string,
    onClick: () => void,
    bgColor?: string,
}

const CustomButton = (props: CustomButtonProps) => {
    return (
        <div>
            <Button variant="contained" color="primary" onClick={props.onClick} style={{ backgroundColor: props.bgColor, }}>
                {props.btnText}
            </Button>
        </div>
    )
}

export default CustomButton
